import React from 'react';

const NewsletterSection: React.FC = () => (
  <section className="py-8 bg-white flex flex-col items-center">
    <h2 className="text-lg font-bold mb-2">Subscribe To Our Newsletter!</h2>
    <form className="flex gap-2">
      <input type="email" placeholder="your@email.com" className="border px-4 py-2 rounded" />
      <button className="bg-orange-500 text-white px-4 py-2 rounded">Subscribe</button>
    </form>
  </section>
);

export default NewsletterSection;
